const { Box, Typography, useTheme } = require("@mui/material");

const Login = () => {
  const theme = useTheme();

  return (
    <Box>
        <Box
            width="100%"
              backgroundColor={theme.palette.background.alt}
              p="1rem 6%"
        >
              <Typography
                  fontWeight="bold"
                  variant="h3"
                  color="primary"
              
              >
                  SOCIAL
              </Typography>
        </Box>

        <Box>
            <Typography>
                Welcome to Socail Media
              </Typography>
              
            <div>
                  
            </div>
        </Box>
    </Box>
  );
};

export default Login;
